Here is the action array to generate reports summarizing business data:
<OUTPUT_JSON>
[
  {
    "action": "click",
    "selector": "select[name*=\"report\" i]",
    "description": "Select the type of report to generate from a dropdown"
  },
  {
    "action": "click", 
    "selector": "button:has-text(\"generate\" i)",
    "description": "Click the button to generate the selected report"
  },
  {
    "action": "click",
    "selector": "button:has-text(\"export\" i)",
    "description": "Click the button to export the generated report"
  },
  {
    "action": "click",
    "selector": "a:has-text(\"download\" i)",
    "description": "Click the link to download the exported report file"
  }
]
</OUTPUT_JSON>
